import React from "react";
import api from './api';
import {
    Routes,
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
import Atleta from "./Atleta";

function Ranking(){
    state = {
        atletas: [],
      }
    
      const response = api.get('');
      this.setState({atletas: response.data});
    
        const {atletas} = this.state;
        const path = "/atleta/";
        return (
                <div>
                 <h1 id="ranking-title">Atletas</h1>
                  {atletas.map(atleta => (
                    <p><NavLink to={path+atleta.nome}>{atleta.nome} - {atleta.pontos}</NavLink></p>
                  ))}
                  </div>
             );
}

export default Ranking;
